import React from "react";
import { Navbar, Container, Nav, FormControl } from "react-bootstrap";
import "./App.css";

const Header = () => {
  return (
    <header>
      <div className="video-section">
        {/* Background video */}
        <video
          className="background-video"
          src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/04/maison-mirabeau-header-2023.mp4"
          autoPlay
          loop
          muted
        />

        {/* Overlay image at the bottom right corner */}
        <img
          className="overlay-image"
          src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/09/b-corp-logo-en.svg"
          alt="Overlay Image"
        />
      </div>

      {/* Navigation bar */}
      <Navbar bg="light" expand="lg" variant="light" fixed="top">
        <Container>
          {/* Logo */}
          <Navbar.Brand href="#home">
            <img
              src="https://s3.amazonaws.com/shecodesio-production/uploads/files/000/126/912/original/mirabeau-logo.png?1716116679"
              className="logo"
            ></img>
          </Navbar.Brand>
          {/* Navigation Links */}
          <Nav className="mr-auto nav-links">
            <Nav.Link href="#">OUR RANGE</Nav.Link>
            <Nav.Link href="#">SHOP</Nav.Link>
            <Nav.Link href="#">ABOUT</Nav.Link>
            <Nav.Link href="#">JOURNAL</Nav.Link>
            <Nav.Link href="#">B CORP</Nav.Link>
            <Nav.Link href="#">EN</Nav.Link>
            <Nav.Link href="#">FR</Nav.Link>
            <Nav.Link href="#">DE</Nav.Link>
            <Nav.Link href="#">JP</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
